    int len = inputsize;
    int idx = 0;
    input[idx] = '\0';
    while (1)
    {
        char c = fgetc(stdin);
        if (c == EOF)
            break;
        if (c == '\n')
        {
            input[idx++] = '\0';
            break;
        }
        else {
            input[idx++] = c;
        }
        if (idx >= len - 1)
        {
            input[idx++] = '\0';
            break;
        }
    }
}

