enum tokentype
{
    OP, NUM, LP, RP
};
typedef struct token {
    int tokentype;
    char val[16];
    struct token* prev;
    struct token* next;
} token;

token* newtoken()
{
    token* tokennew = malloc(sizeof(token));
    tokennew->next = NULL;
    tokennew->prev = NULL;
    tokennew->val[0] = '\0';
    return tokennew;
}


void tokenmoveon(token** tokencurr)
{
    (*tokencurr)->next = newtoken();
    (*tokencurr)->next->next = NULL;
    (*tokencurr)->next->prev = (*tokencurr);
    (*tokencurr) = (*tokencurr)->next;
}

void printtoknetype(int type)
{
    switch (type)
    {
    case OP:
        printf("OP");
        break;
    case NUM:
        printf("NUM");
        break;
    case LP:
        printf("LP");
        break;
    case RP:
        printf("RP");
        break;
    default:
        break;
    }
}

